import React from "react";

const CardPage = ({ houseInfo }) => {
  return (
    <>
      <div className="filterhandles">
        <div className="headText">{houseInfo.location.area}</div>
      </div>
      <div>CardView {houseInfo.location.area} </div>
    </>
  );
};

export default CardPage;
